import React, { Component } from 'react';
import './App.css';
import Button from '@material-ui/core/Button';

class App extends Component {

    render() {
      return (
        <div class="flex" >
            <Button class="outline w-25 pa3 mr2">Home</Button>
            <Button class="outline w-25 pa3 mr2">About</Button>
            <h1 class="outline w-25 pa3 mr2">Katie Macaulay</h1>
            <Button class="outline w-25 pa3 mr2">Work</Button>
            <Button class="outline w-25 pa3">Contact</Button>
        </div>
      );
    }
  }

  export default App;
